import React from "react";

export default function Todo({ todos }) {
  //   todos.map((todo) => {
  //     console.log("todos : " + todo.id);
  //     console.log("todos : " + todo.headline);
  //     console.log("todos : " + todo.description);
  //   });

  return (
    <>
      <div>Todoooooooooooo</div>
      <div>
        {todos.map((todo) => {
          <h1>{todo.id}</h1>;
        })}
      </div>
    </>
  );
}
